  input: '"TEXT","F3XA",,"The Pryce Project includes a request for required donor
    information as required by federal law in every solicitation it does.  If a contribution
    is received without it, a written request for the information is sent within 30
    days, along with a pre-addressed return envelope.  Any contributor information
    received as a result of the PAC''s best efforts is reported to the Commission
    either in an amended report or on the next report. With regard to the PAC''s administrative
    expenses, the Pryce Project retains a law firm to administer the PAC.  The firm''s
    services include record-keeping, check writing, and preparation of the FEC reports.  So
    the retainer includes those normal administrative expenses to which you refer.  Also,
    because all the record-keeping is done by the law firm, the PAC does not need
    an office."'
